import React, {useEffect, useState} from 'react'
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Signup from './Pages/Signup';

function App() {
  return (

        <div className='main-content'>
          <BrowserRouter>
            <Routes>

            <Route path='/' element={<Signup />} />
            </Routes>
          </BrowserRouter>

        </div>

  );
}

export default App
